    false,nt"url": null,nt"notes": "NODC Accession 0129838 includes physical,
    profile and underway data collected aboard the ROGER REVELLE during cruise RR1109
    in the South China Sea (Nan Hai) from 2011-06-21 to 2011-07-07. These data include
    CONDUCTIVITY, CURRENT SPEED - EAST/WEST COMPONENT (U), CURRENT SPEED - NORTH/SOUTH
    COMPONENT (V), SALINITY and WATER TEMPERATURE. The instruments used to collect these
    data include ADCP, CTD and GPS. These data were collected by Louis St. Laurent of
    Woods Hole Oceanographic Institution, and by University of California - San Diego;
    Scripps Institution of Oceanography as part of Internal Waves in Straits Experiment
    (IWISE). The Lamont-Doherty Earth Observatory (LDEO) submitted these data to NODC
    as part of the NSF sponsored Rolling Deck to Repository (R2R) program.nnThe ADCP
    data represent the raw and automated processed data set. Post processed quality
    assessed data are not available in this accession.",nt"license_title": null,nt"extras":
